    if( activityType){
        if( [rv isEqualToString:@"WeightedMeanCadence"]){
            if( [activityType isEqualToString:GC_TYPE_RUNNING]){
                rv = @"WeightedMeanRunCadence";
            }else if ([activityType isEqualToString:GC_TYPE_CYCLING]){
                rv = @"WeightedMeanBikeCadence";
            }else if ([activityType isEqualToString:GC_TYPE_SWIMMING]){
                rv = @"WeightedMeanSwimCadence";
            }
        }else if ([rv isEqualToString:@"MaxCadence"]){
            if( [activityType isEqualToString:GC_TYPE_RUNNING]){
                rv = @"MaxRunCadence";
            }else if ([activityType isEqualToString:GC_TYPE_CYCLING]){
                rv = @"MaxBikeCadence";
            }else if ([activityType isEqualToString:GC_TYPE_SWIMMING]){
                rv = @"MaxSwimCadence";
            }
        }
    }
    static NSMutableDictionary * missing = nil;
    if( missing == nil){
        missing = [NSMutableDictionary dictionary];
        RZRetain(missing);
    }
    if( rv == nil){
        if(! missing[fitfield]){
            RZLog(RZLogInfo, @"Unmapped fitField %@ %@", fitfield,activityType?:@"");
            missing[fitfield] = @(1);
        }
    }
    
    return rv;
}

